(1, 'Mathematics', 'mathematics', '', 'Mathematics is the study of topics such as quantity (numbers), structure, space, and change. There is a range of views among mathematicians and philosophers.', 1788, '2017-02-07 05:29:49', '2017-02-09 04:55:57'),
(2, 'Physics', 'physics', '', 'The intellectual and practical activity encompassing the systematic study of the structure and behaviour of the physical and natural world through observation and experiment.', 1788, '2017-02-07 05:30:09', '2017-02-09 04:56:10'),
(3, 'Chemistry', 'chemistry', '', 'The branch of science concerned with the substances of which matter is composed, the investigation of their properties and reactions, and the use of such reactions to form new substances.', 1788, '2017-02-07 05:30:37', '2017-02-09 04:55:07'),
(4, 'Botany', 'botany', '', 'The scientific study of the physiology, structure, genetics, ecology, distribution, classification, and economic importance of plants.', 1788, '2017-02-07 05:31:03', '2017-02-09 04:54:44'),
