(6, 'English', 'english', '', 'English is a West Germanic language that was first spoken in early medieval England and is now a global lingua franca', 1788, '2017-02-07 05:31:42', '2017-02-09 04:55:31'),
(7, 'Environmental Studies', 'environmental-studies', '', 'Environmental studies is a multidisciplinary academic field which systematically studies human interaction with the environment in the interests of solving complex problems.', 1788, '2017-02-07 05:32:17', '2017-02-09 04:55:44'),
(8, 'Physics Lab', 'physics-lab', '', 'Physics class, lab is central. Integral. Sacred. More than a mere place in the back of the classroom, the laboratory is the place where physics students.', 1788, '2017-02-07 05:41:01', '2017-02-09 04:56:23'),
(9, 'Chemistry Lab', 'chemistry-lab', '', 'Teams will demonstrate chemistry laboratory skills and answer questions related to thermodynamics and gas laws.', 1788, '2017-02-07 05:41:39', '2017-02-09 04:55:19'),
(10, 'Zoology Lab', 'zoology-lab', '', 'One of the world\'s largest collections of rare and magnificent bird specimens. ... He constructed the building it was to be housed in, now known as the Moore Lab of Zoology, and gave an endowment ensuring the maintenance, upkeep, and further studying of his massive collection.', 1788, '2017-02-07 05:42:07', '2017-02-09 04:56:54'),
