INSERT INTO `lmscontents` (`id`, `title`, `slug`, `code`, `image`, `subject_id`, `content_type`, `is_url`, `file_path`, `description`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'Functions', 'functions-bb636da0eb3b984e379f11264c366f5b7260e881', 'M1A-F', '', 1, 'file', 0, '1-lms_file.pdf', '<p>Advanced <em>Mathematical</em> Concepts. Any other reproduction, for use or sale, is prohibited without prior written permission of the publisher. Send all inquiries.</p>\r\n', 1788, '2017-02-07 06:09:37', '2017-02-09 05:09:40'),
(2, 'Diffrensiations', 'diffrensiations-13b6ef2d9e79540ec1c06fe3ce2540bcc9a3db7b', 'M1A-D', '', 1, 'iframe', 0, 'https://www.youtube.com/embed/jRAw12erTMQ', '<p><em>MATH 1A</em> - MIDTERM 1 - <em>SOLUTIONS</em>. PEYAM RYAN TABRIZIAN. 1. (10 points) Find the domain of f(x) = ln(x) +. &radic;. 1 &minus; x2. We want: (i) x &gt; 0.</p>\r\n', 1788, '2017-02-07 06:11:52', '2017-02-09 05:10:01'),
(3, 'Trigonometry', 'trigonometry-91de894720c8d177764aa983b835f94b620434bb', 'M1A-T', '', 1, 'url', 0, 'https://en.wikipedia.org/wiki/Mathematics_education_in_Australia', '<p>Maths A covers more practical topics than Maths B and C, but it is still OP eligible. There are considerably fewer algebraic concepts in this subject, and it is suitable for students who either struggled with mathematics in Year 10, or who do not require a knowledge of abstract mathematics in the future. Maths A is designed to help students to develop an appreciation of the value of Mathematics to humanity.</p>\r\n', 1788, '2017-02-07 06:13:22', '2017-02-09 05:10:18'),
(4, 'Transpose of a matrix', 'transpose-of-a-matrix-6ec64f95eecb350abfbe9bf50778cf2123afe161', 'M1A-TM', '', 1, 'url', 0, 'https://en.wikipedia.org/wiki/Transpose', '<p>In&nbsp;linear algebra, the transpose of a&nbsp;matrix&nbsp;is an operator which flips a matrix over its diagonal, that is it switches the row and column indices of the matrix by producing another matrix denoted as&nbsp;<strong>A</strong>T&nbsp;(also written&nbsp;<strong>A</strong>&prime;,&nbsp;<strong>A</strong>tr,&nbsp;t<strong>A</strong>&nbsp;or&nbsp;<strong>A</strong>t). It is achieved by any one of the following equivalent actions</p>\r\n', 1788, '2017-02-07 06:15:32', '2017-02-09 05:06:08'),
(5, 'Determinants', 'determinants-eb86c0a9fc487139ef0f845f5f49670380a8bbdb', 'M1A-DD', '', 1, 'iframe', 0, 'https://www.youtube.com/embed/pKZyszzmyeQ', '<p>Note that the order of the factors reverses. From this one can deduce that a&nbsp;square matrix&nbsp;<strong>A</strong>&nbsp;is&nbsp;invertible&nbsp;if and only if&nbsp;<strong>A</strong>T&nbsp;is invertible, and in this case we have (<strong>A</strong>&minus;1)T&nbsp;= (<strong>A</strong>T)&minus;1. By induction this result extends to the general case of multiple matrices, where we find that (<strong>A</strong>1<strong>A</strong>2...<strong>A</strong><em>k</em>&minus;1<strong>A</strong><em>k</em>)T&nbsp;=&nbsp;<strong>A</strong><em>k</em>T<strong>A</strong><em>k</em>&minus;1T...<strong>A</strong>2T<strong>A</strong>1T.</p>\r\n', 1788, '2017-02-07 06:18:47', '2017-02-07 06:18:47'),
(6, 'Adjoint and Inverse of a matri', 'adjoint-and-inverse-of-a-matri-a288609b20f14df5cd4aa3328ddf6b2f8675131c', 'M2A-AIM', '', 9, 'url', 0, 'http://www.geeksforgeeks.org/adjoint-inverse-matrix/', '<p>Adjoint (or Adjugate) of a matrix is the matrix obtained by taking transpose of the cofactor matrix of a given square matrix is called its Adjoint or Adjugate matrix. The Adjoint of any square matrix &lsquo;A&rsquo; (say) is represented as Adj(A).</p>\r\n', 1788, '2017-02-07 06:21:18', '2017-02-09 05:07:14'),
(7, 'Solution of simultaneous linear equations', 'solution-of-simultaneous-linear-equations-a44624449a82b212846ff3c8ee7ab59700179a73', 'M2A-SSIE', '', 9, 'file', 0, '7-lms_file.pdf', '<p>The purpose of this section is to look at the solution of simultaneous linear equations. We will see that solving a pair of simultaneous equations is equivalent to finding the location of the point of intersection of two straight lines.</p>\r\n', 1788, '2017-02-07 06:22:57', '2017-02-09 05:07:33'),
(8, 'Problems on divisibility', 'problems-on-divisibility-c0671cdbbefa60dd615f86f382b40a4f0919251b', 'M2A-PD', '', 9, 'iframe', 0, 'https://www.youtube.com/embed/NPzlCNDEJqA', '<p>In order to master the techniques explained here it is vital that you undertake plenty of practice exercises so that all this becomes second nature. To help you to achieve this, the unit includes a number of such exercises.</p>\r\n', 1788, '2017-02-07 06:25:04', '2017-02-09 05:07:51'),
(9, 'Classification of vectors.', 'classification-of-vectors-42b38f3fd7d5972a0d146a3042f7cdc89fda61b4', 'M2A-CV', '', 9, 'file', 0, '9-lms_file.pdf', '<p>The scope of this chapter is to provide an overview of the main vectors of medical importance encountered in refugee/displaced person camps.</p>\r\n', 1788, '2017-02-07 06:26:43', '2017-02-09 05:08:07'),
(10, 'Behaviour of gases', 'behaviour-of-gases-f992c8feb69b9914de81fe70264c6ac76d4b0a82', 'P1-BG', '', 3, 'file', 0, '10-lms_file.pdf', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi accumsan nisl a massa consequat, a imperdiet ante ullamcorper. Praesent ultricies vestibulum aliquet. Proin non ex ac velit mollis fringilla a sit amet odio.</p>\r\n', 1788, '2017-02-07 06:35:32', '2017-02-09 05:08:23'),
(11, 'Molecular nature of matter', 'molecular-nature-of-matter-52c72a999d4b36c6832c22a71119af096ed7ef7f', 'P1-MM', '', 3, 'iframe', 0, 'https://www.youtube.com/embed/ELchwUIlWa8', '<p>Ut porttitor varius lacus. Vestibulum id libero nec orci maximus fringilla. Vivamus id ligula id tellus sagittis porta. Praesent ex quam, fringilla a commodo ac, scelerisque ac turpis. Curabitur condimentum viverra dolor sit amet venenatis.</p>\r\n', 1788, '2017-02-07 06:37:11', '2017-02-09 05:08:42'),
(12, 'Kinetic theory of an ideal gas', 'kinetic-theory-of-an-ideal-gas-5f11ad644d6a9a4fcd656cc6e04dade027cb46a4', 'P1-KTIG', '', 3, 'url', 0, 'https://en.wikipedia.org/wiki/Kinetic_theory_of_gases', '<p>The&nbsp;<strong>kinetic theory</strong>&nbsp;describes a gas as a large number of submicroscopic particles (atoms&nbsp;or&nbsp;molecules), all of which are in constant rapid&nbsp;motion&nbsp;that has&nbsp;randomness&nbsp;arising from their many collisions with each other and with the walls of the container.</p>\r\n', 1788, '2017-02-07 06:38:19', '2017-02-09 05:08:59'),
(13, 'Law of equipartition of energy', 'law-of-equipartition-of-energy-cb829173a62c1f2d81daaddbc5e24a9f0230f575', 'P2-LEE', '', 11, 'url', 0, 'http://hyperphysics.phy-astr.gsu.edu/hbase/Kinetic/eqpar.html', '<p>Donec a enim lacus. Ut placerat ligula lobortis arcu maximus rutrum. Aliquam posuere risus a nisi mollis, in volutpat lectus euismod. Nunc ut sem a tellus malesuada sagittis</p>\r\n', 1788, '2017-02-07 06:39:26', '2017-02-09 05:09:21'),
(14, 'Specific heat capacity', 'specific-heat-capacity-bdb8767ea53489638158e1b5c717143ee6c49129', 'P2-SHC', '', 11, 'file', 0, '14-lms_file.pdf', '<p>Heat capacity (usually denoted by a capital C, often with subscripts), or thermal capacity, is the measurable physical quantity that characterizes the amount of heat required to change a body&#39;s temperature by a given amount.</p>\r\n', 1788, '2017-02-07 06:40:32', '2017-02-09 05:02:50'),
(15, 'Mean free path', 'mean-free-path-96e4c966a1910c5f27384280b20b6215ef943ae6', 'P2-MFP', '', 11, 'iframe', 0, 'https://www.youtube.com/embed/_vUtO3BS-zM', '<p>Praesent ex quam, fringilla a commodo ac, scelerisque ac turpis. Curabitur condimentum viverra dolor sit amet venenatis.</p>\r\n', 1788, '2017-02-07 06:42:08', '2017-02-09 05:03:08'),
(16, 'Bohrs model for Hydrogen atom.', 'bohrs-model-for-hydrogen-atom-5f650c485225b9c6f27a3dab984ad2b89e866444', 'CHE1-BHT', '', 4, 'iframe', 0, 'https://www.youtube.com/embed/roGs6TwDRvY', '<p>Donec a enim lacus. Ut placerat ligula lobortis arcu maximus rutrum. Aliquam posuere risus a nisi mollis, in volutpat lectus euismod. Nunc ut sem a tellus malesuada sagittis. Phasellus euismod ante malesuada quam fermentum, sed tempus metus dignissim.</p>\r\n', 1788, '2017-02-07 08:57:27', '2017-02-09 05:03:25'),
(17, 'Dual behavior of matt', 'dual-behavior-of-matt-75a340e70033dec513888d0dc695fb547503a78c', 'CHE1-DBM', '', 4, 'url', 0, 'https://phys.org/news/2014-12-quantum-physics-complicated.html', '<p>The connection between uncertainty and wave-particle duality comes out very naturally when you consider them as questions about what information you can gain about a system.<br />\r\n<br />\r\n&nbsp;</p>\r\n', 1788, '2017-02-07 08:58:43', '2017-02-09 04:57:37'),
(18, 'Shapes of atomic orbitals', 'shapes-of-atomic-orbitals-1d199b0e3090d5d883563847a2e9464e5be80dd0', 'CHE1-SAO', '', 4, 'file', 0, '18-lms_file.pdf', '<p>Filling of orbitals in atoms. Aufbau Principle, Pauli&rsquo;s</p>\r\n\r\n<p>exclusion Principle and Hund&rsquo;s rule of maximum multiplicity</p>\r\n', 1788, '2017-02-07 09:00:46', '2017-02-09 05:03:55'),
(19, 'Thermal Energy', 'thermal-energy-35601e64e1b1fe70a99f77afbea6972b28d12681', 'CHE2-TE', '', 12, 'file', 0, '19-lms_file.pdf', '<p>In order to apply energy conservation to a falling ball or a roller coaster in the previous chapter, we had to assume that friction (with the air or the track) was negligible</p>\r\n', 1788, '2017-02-07 09:02:27', '2017-02-09 05:04:14'),
(20, 'The Gaseous State.', 'the-gaseous-state-71dd0879636ffb5b2ac59ad872119258cd84b884', 'CHE2-GS', '', 12, 'iframe', 0, 'https://www.youtube.com/embed/fucyI7Ouj2c', '<p>But besides draining objects of their mechanical energy, friction also has another effect: It raises the temperature of objects. Everyone knows that you can warm up cold hands by briskly rubbing them together. Tires skidding along the road result in burnt rubber.</p>\r\n', 1788, '2017-02-07 09:04:55', '2017-02-09 05:04:35'),
(21, 'Ideal gas equation', 'ideal-gas-equation-c86b2cf49f0756bc47a69fe5f4c1569888628971', 'CHE2-IGE', '', 12, 'url', 0, 'https://en.wikipedia.org/wiki/Ideal_gas_law', '<p>How much gas is present could be specified by giving the mass instead of the chemical amount of gas. Therefore, an alternative form of the ideal gas law may be useful. The chemical amount (<em>n</em>) (in moles) is equal to the total mass of the gas (<em>m</em>) (in grams) divided by the&nbsp;molar mass&nbsp;(<em>M</em>) (in grams per mole)</p>\r\n', 1788, '2017-02-07 09:05:52', '2017-02-09 05:04:59'),
(22, 'Binary fission', 'binary-fission-a78d1ac4e65bbdec66f0a19d7e76d9133b765be5', 'BOT1-BF', '', 5, 'url', 0, 'https://en.wikipedia.org/wiki/Fission_(biology)', '<p>In biology,&nbsp;<strong>fission</strong>&nbsp;is the division of a single entity into two or more parts and the regeneration of those parts into separate entities resembling the original. The object experiencing fission is usually a&nbsp;cell.</p>\r\n', 1788, '2017-02-07 09:07:33', '2017-02-09 05:05:14'),
(23, 'Sporulation', 'sporulation-11adaa889d89c807dd2a3aea827aa2035e1320e1', 'BOT1-S', '', 5, 'file', 0, '23-lms_file.pdf', '<p>Bacteria that form a single spore (endospore) within the cell. Sporulating bacteria are usually rodshaped and are called bacilli.</p>\r\n', 1788, '2017-02-07 09:08:35', '2017-02-09 05:05:32'),
(24, 'fragmentation', 'fragmentation-e91dd141a01b506bdb89595f0ca60cb54783b122', 'BOT1-FRG', '', 5, 'iframe', 0, 'https://www.youtube.com/embed/BZYtiqLz6cg', '<p>Endospores are hardy, defensive structures that enable some bacteria to surviveharmful environmental conditions, such as starvation, high temperatures, desiccation,chemical disinfectants and extremes in pH.</p>\r\n', 1788, '2017-02-07 09:09:54', '2017-02-09 05:05:49'),
(25, 'Acoelomates,', 'acoelomates-83c4cabbaf1c2714664c4bd6a9738cc9f9d05722', 'ZO1-A', '', 14, 'iframe', 0, 'https://www.youtube.com/embed/nUZZ7S-wZyQ', '<p>Each endospore is produced by a vegetative cell, an active bacterial cell that undergoes metabolism, divides and goes about the dailybusiness of being alive.</p>\r\n', 1788, '2017-02-07 09:11:37', '2017-02-09 05:00:03'),
(26, 'Eucoelomates', 'eucoelomates-a4bc7843df248e4a54fdd037654c5a537cc4d8d7', 'ZO1-E', '', 6, 'file', 0, '26-lms_file.pdf', '', 1788, '2017-02-07 09:12:57', '2017-02-09 05:00:21'),
(27, 'Ctenophora', 'ctenophora-33e09ce1fd1d7897b2e90575db8c38e50ab140be', 'ZO1-C', '', 6, 'url', 0, 'https://en.wikipedia.org/wiki/Ctenophora', '<p>Almost all ctenophores are predators, taking prey ranging from microscopic&nbsp;larvae&nbsp;and&nbsp;rotifers&nbsp;to the adults of small&nbsp;crustaceans; the exceptions are juveniles of two species, which live as parasites on the&nbsp;salps&nbsp;on which adults of their species feed. In favorable circumstances, ctenophores can eat ten times their own weight in a day.</p>\r\n', 1788, '2017-02-07 09:13:55', '2017-02-09 05:00:40'),
(28, 'Air pollution', 'air-pollution-c5684b912155069636fd9f2a782961097b2f3880', 'ES-A', '', 8, 'file', 0, '28-lms_file.pdf', '<p>The phenomenon of air pollution involves a sequence of events: the generation of pollutants at and their release from a source; their transport and transfonnation in and removal from the atmosphere; and their effects on human beings, materials, and ecosystems.</p>\r\n', 1788, '2017-02-07 09:15:58', '2017-02-09 05:00:57'),
(29, 'Water pollution', 'water-pollution-9dec7dd9eb19d699543f4e9887065124878202b0', 'ES-W', '', 8, 'url', 0, 'https://en.wikipedia.org/wiki/Water_pollution', '<p>ater pollution affects the entire biosphere&nbsp;&ndash; plants and organisms living in these&nbsp;bodies of water. In almost all cases the effect is damaging not only to individual&nbsp;species&nbsp;and population, but also to the natural&nbsp;biological communities.</p>\r\n', 1788, '2017-02-07 09:18:02', '2017-02-09 05:01:13'),
(30, 'Noise Pollution', 'noise-pollution-23d4ecf40c34c89feb800a2e4bd0d10cf24356a1', 'ES-NP', '', 8, 'iframe', 0, 'https://www.youtube.com/embed/AQ4BakagMvM', '<p>Pellentesque dignissim velit eu diam consequat dapibus. Phasellus ultrices porta libero, et sollicitudin orci. Morbi aliquet dignissim arcu et blandit. Etiam fermentum lectus eros, a bibendum justo vestibulum eu. Curabitur tincidunt metus vel justo dignissim, ac dapibus nibh mollis. Duis interdum maximus ultrices.</p>\r\n', 1788, '2017-02-07 09:19:57', '2017-02-09 05:01:28'),
(31, 'Earth Pollution', 'earth-pollution-9a5413474064e6192cf3d71c5e68b241daf932e3', 'ES-E', '', 8, 'url', 0, 'https://en.wikipedia.org/wiki/Pollution', '<p><strong>Pollution</strong>&nbsp;is the introduction of&nbsp;contaminants&nbsp;into the natural environment that cause adverse change.&nbsp;Pollution can take the form of&nbsp;chemical substances&nbsp;or&nbsp;energy, such as noise, heat or light.</p>\r\n', 1788, '2017-02-07 09:21:35', '2017-02-09 05:01:45'),
(32, 'Detailed lessons', 'detailed-lessons-cd6f43d52a0f7bb4aef38f21f8c67dafbc60d248', 'ENG-DL', '', 15, 'iframe', 0, 'https://www.youtube.com/embed/92Pw7uAAtcg', '<p>Ut ultricies dui id posuere vestibulum. Praesent non libero sapien. Cras eu leo aliquam, viverra orci sed, convallis orci. Vestibulum dignissim magna ut ipsum elementum, ac pretium sapien dictum. Ut vitae orci convallis, gravida arcu eget, pretium sem.</p>\r\n', 1788, '2017-02-07 09:27:40', '2017-02-09 05:02:01'),
(33, 'Non detailed Lessons', 'non-detailed-lessons-c9441e418781b4b8f4290dfbc3c3b36347bff520', 'ENG-ND', '', 7, 'file', 0, '33-lms_file.pdf', '<p>Donec a enim lacus. Ut placerat ligula lobortis arcu maximus rutrum. Aliquam posuere risus a nisi mollis, in volutpat lectus euismod. Nunc ut sem a tellus malesuada sagittis. Phasellus euismod ante malesuada quam fermentum, sed tempus metus dignissim. Nam a varius dolor.</p>\r\n', 1788, '2017-02-07 09:28:54', '2017-02-09 05:02:18'),
(34, 'Poems', 'poems-da388bee2a3b17fe9b3098e0acc1598195fbcede', 'ENG-P', '', 7, 'url', 0, 'https://www.poets.org/poetsorg/poems', '<p>Fusce orci magna, suscipit ut odio quis, tristique ultricies turpis. Aliquam facilisis, purus et gravida sollicitudin, lorem metus posuere ipsum, ut mattis elit quam eget odio. Morbi sodales nisl metus, a blandit leo iaculis sed. Vivamus interdum nisl non malesuada sagittis.</p>\r\n', 1788, '2017-02-07 09:29:36', '2017-02-09 05:02:33'),
(35, 'Grammar', 'grammar-7a093ba1e774002f6ff4665d7a09dd16d88d7583', 'ENG-G', '', 7, 'audio_url', 0, 'http://www.englishgrammarsecrets.com/', '<p>Nullam scelerisque arcu massa, id varius enim molestie vel. Morbi eget sapien volutpat, posuere leo vel, bibendum justo. Nunc volutpat sem in lacus ultrices, ac egestas magna ultrices</p>\r\n', 1788, '2017-02-07 09:30:28', '2017-02-09 04:59:44'),
