(37, 'Nouns', 'nouns-fbe16dbadd75801a46dc889f0f1cd517378ea902', 'ENG-N', '', 15, 'url', 0, 'http://www.gingersoftware.com/content/grammar-rules/nouns/', '', 1788, '2017-02-07 11:38:14', '2017-02-09 04:59:15'),
(38, 'Tenses', 'tenses-1083e6a6942d38b3fb56824ca81b7115bbc1f051', 'ENG-T', '', 15, 'iframe', 0, 'https://www.youtube.com/embed/KcBbY_fXVt8', '<p>Of all the parts of speech, nouns are perhaps the most important. A noun is a word that identifies a person, animal, place, thing, or idea. Here, we&rsquo;ll take a closer look at what makes a noun a noun, and we&rsquo;ll provide some noun examples, along with some advice for using nouns in your sentences.</p>\r\n', 1788, '2017-02-07 11:39:47', '2017-02-09 04:58:59'),
