(1, 'Mathematics-1A', 'mathematics-1a', 0, '0.00', -1, 5, 1, '', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>\r\n', '<p><em>Mathematics</em> (from Greek &mu;&theta;&eta;&mu;&alpha; m&aacute;thma, &ldquo;knowledge, study, learning&rdquo;) is the study of topics such as quantity (numbers), structure, space, and change. There is a range of views among <em>mathematicians</em> and philosophers as to the exact scope and definition of <em>mathematics</em>.</p>\r\n', '2017-02-07', '2020-01-01', 1788, '2017-02-07 05:35:36', '2017-02-10 12:58:52'),
