INSERT INTO `notifications` (`id`, `title`, `slug`, `short_description`, `description`, `url`, `valid_from`, `valid_to`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'Combined Graduate Level Competitive Exam 2017', 'combined-graduate-level-competitive-exam-2017', 'Staff Selection Commission (SSC) is an organization controlled by Government of India', '<p>Staff Selection Commission (SSC) is an organization controlled by Government of India for the purpose of recruiting staff for various posts in various Ministries and reputed Departments of the Government of India and in their Subordinate Offices.</p>\r\n\r\n<p>- See more at: https://www.eduncle.com/ssc-cgl-recruitment-exam#sthash.NXqAm58d.dpuf</p>\r\n', '', '2016-11-17', '2017-06-30', 21753, '2016-11-16 23:50:25', '2016-11-16 23:50:25'),
(2, ' Probationary Officers', 'probationary-officers', 'Applications are invited from eligible Indian citizens for appointment as Probationary Officers (POs) in State Bank of India. Candidates selected are liable to be posted anywhere in India.', '<p>Applications are invited from eligible Indian citizens for appointment as Probationary Officers (POs) in State Bank of India. Candidates selected are liable to be posted anywhere in India.</p>\r\n\r\n<p>Any eligible candidate, who aspires to join State Bank of India as a Probationary Officer, is required to register online for the Recruitment Process. The examination will be held in two phases - preliminary and main. Candidates who will qualify in preliminary examination and shortlisted will have to appear for main examination and shortlisted candidates in the main examination will subsequently be called for a Group Discussion &amp; Interview.</p>\r\n\r\n<p>Prospective candidates will have to apply after carefully reading the advertisement regarding the process of examinations and interview, eligibility criteria, online registration processes, payment of prescribed application fee/intimation charges, pattern of examination, issuance of call letters etc. and ensure that they fulfil the stipulated criteria and follow the prescribed processes.</p>\r\n', 'https://www.talentsprint.com//misc/bank/notifications-pdf/sbi-po-2016.pdf', '2016-11-17', '2017-01-31', 21753, '2016-11-16 23:52:51', '2016-11-16 23:52:51'),
(3, 'Specialist Officer ', 'specialist-officer', 'Institute of Banking Personnel Selection (IBPS) has released a notification for the recruitment', '<p>Institute of Banking Personnel Selection (IBPS) has released a notification for the recruitment of 4122 Specialist Officers in nationalized banks and financial institutions through IBPS CRP SPL-VI examination. Interested candidates may check the eligibility criteria and apply online from 16-11-2016 to 02-12-2016.</p>\r\n', '', '2016-11-17', '2016-12-02', 21753, '2016-11-17 10:14:58', '2016-11-17 10:14:58'),
(4, 'Executives ', 'executives', 'IDBI Bank Limited has released a notification for the recruitment of 500 Executives. ', '<p>IDBI Bank Limited has released a notification for the recruitment of 500 Executives. Interested candidates may check the eligibility criteria and apply online from 16-11-2016 to 30-11-2016.</p>\r\n', '', '2016-11-17', '2016-11-30', 21753, '2016-11-17 10:16:18', '2016-11-17 10:16:18'),
(5, 'Police Constable', 'police-constable', 'Jammu & Kashmir Police has released a notification for the recruitment of 5381 Constable', '<p>Jammu &amp; Kashmir Police has released a notification for the recruitment of 5381 Constable in IRP Battalions, Executive Police and Armed Police. Interested candidates may check the eligibility criteria and apply online from 25-10-2016 to 20-11-2016.</p>\r\n', '', '2016-11-17', '2016-11-25', 21753, '2016-11-17 10:18:03', '2016-11-17 10:18:03'),
(6, 'RPF Recruitment 2015 Lady Constable 1599 jobs', 'rpf-recruitment-2015-lady-constable-1599-jobs', 'Railway protection force (RPF) is going to release a recruitment notification for the Recruitment of 1599 Lady Constable soon.', '<p><strong>RPF Recruitment Notification 2015 for 1599 Lady Constable</strong></p>\r\n\r\n<p>Railway protection force (RPF) is going to release a recruitment notification for the Recruitment of 1599 Lady Constable soon. Female candidates who want to grab this opportunity are requested to bookmark this link for latest updates on RPF Lady Constable vacancy.</p>\r\n', 'indianrailways.gov.in.', '2016-11-17', '2016-11-17', 21753, '2016-11-17 10:22:26', '2016-11-17 10:22:26'),
(7, 'Postman and Mail Guard', 'postman-and-mail-guard', 'Kerala Postal Circle has released a notification for the recruitment for 594', '<p>Kerala Postal Circle has released a notification for the recruitment for 594 posts of Postman and Mail Guard in Postal Divisions/RMS Divisions in Kerala Postal Circle. Interested candidates may check the eligibility criteria and apply online from 16-01-2017 to 14-02-2017.<br />\r\n&nbsp;</p>\r\n', '', '2017-01-18', '2017-02-15', 21753, '2017-01-18 09:14:07', '2017-01-18 09:14:07'),
(8, 'Probationary Officers and Probationary Clerks ', 'probationary-officers-and-probationary-clerks', 'The South Indian Bank Ltd., a premier Commercial Bank in India, has released ', '<p>The South Indian Bank Ltd., a premier Commercial Bank in India, has released a notification for the recruitment of 537 Probationary Officers and Probationary Clerks. Interested candidates may check the eligibility criteria and apply online from 19-01-2017 to 27-01-2017.</p>\r\n', '', '2017-01-18', '2017-01-27', 21753, '2017-01-18 09:15:25', '2017-01-18 09:15:25'),
(9, 'Technician Apprentice', 'technician-apprentice', 'Indian Oil Corporation Limited (IOCL) has released a notification for the recruitment of 89 ', '<p>Indian Oil Corporation Limited (IOCL) has released a notification for the recruitment of 89 Technician Apprentice in various disciplines. Interested candidates may check the eligibility criteria and apply online from 01-02-2017 to 13-02-2017.</p>\r\n', '', '2017-01-18', '2017-02-13', 21753, '2017-01-18 09:16:13', '2017-01-18 09:16:13'),
(10, 'Sub Inspector', 'sub-inspector', 'Maharashtra Public Service Commission (MPSC) has released a notification for', '<p>Maharashtra Public Service Commission (MPSC) has released a notification for the recruitment of 300 Excise Sub Inspectors. Interested candidates may check the eligibility criteria and apply online from 13-01-2017 to 02-02-2017.</p>\r\n', '', '2017-01-18', '2017-02-02', 21753, '2017-01-18 09:16:51', '2017-01-18 09:16:51'),
(11, 'Co-Pilot', 'co-pilot', 'Selected candidates will also be required to give Bank Guarantee for the total cost', '<p>Selected candidates will also be required to give Bank Guarantee for the total cost of training to come online including Ground Training / Base Training cost. The above training cost will be recovered from the salary in Equal Monthly Installments</p>\r\n', '', '2017-01-18', '2017-02-11', 21753, '2017-01-18 09:17:31', '2017-01-18 09:17:31'),
(12, 'Engineering Executive', 'engineering-executive', 'NTPC Limited has released a notification for the recruitment of 120 Engineering', '<p>NTPC Limited has released a notification for the recruitment of 120 Engineering Executive Trainees. Interested candidates may check the eligibility criteria and apply before 31-01-2017.</p>\r\n', '', '2017-01-18', '2017-01-31', 21753, '2017-01-18 09:18:18', '2017-01-18 09:18:18'),
(13, 'Group D', 'group-d', 'West Bengal Group D Recruitment Board (WBGDRB) has released a notification', '<p>West Bengal Group D Recruitment Board (WBGDRB) has released a notification for the recruitment for 6000 vacancies of Group D in various offices of State Government. Interested candidates may check the eligibility criteria and apply online from 03-01-2017 to 29-01-2017.</p>\r\n', '', '2017-01-18', '2017-01-29', 21753, '2017-01-18 09:18:58', '2017-01-18 09:18:58'),
(14, 'APSC Combined Competitive Exam Notification', 'apsc-combined-competitive-exam-notification', 'Assam Public Service Commission (APSC) has released a notification', '<p>Assam Public Service Commission (APSC) has released a notification of Combined Competitive Examination, 2016 to fill 205 vacancies. Interested candidates may check the eligibility criteria and apply before 09-02-2017.</p>\r\n', '', '2017-01-18', '2017-02-09', 21753, '2017-01-18 09:19:49', '2017-01-18 09:19:49'),
(15, 'Management Trainee', 'management-trainee', 'Coal India Limited (CIL) has released a notification for the recruitment of 1319 Management Train', '<p>Coal India Limited (CIL) has released a notification for the recruitment of 1319 Management Trainees. Interested candidates may check the eligibility criteria and apply online from 05-01-2017 to 03-02-2017.</p>\r\n', '', '2017-01-18', '2017-02-03', 21753, '2017-01-18 09:20:33', '2017-01-18 09:20:33'),
(16, 'Agriculture Officers ', 'agriculture-officers', 'The proforma Application will be available on Commissions ', '<p>The proforma Application will be available on Commission&rsquo;s Website (www.psc.ap.gov.in) from 31/12/2016 to 30/01/2017 (Note:30/01/2017 is the last date for payment of fee up- to 11:59 mid night)</p>\r\n', 'www.psc.ap.gov.in', '2017-01-18', '2017-01-30', 21753, '2017-01-18 09:21:50', '2017-01-18 09:21:50'),
(17, 'Sub-Inspector, Assistant Sub-Inspector ', 'sub-inspector-assistant-sub-inspector', 'Sashastra Seema Bal has released a notification for the recruitment of 872 candidates', '<p>Sashastra Seema Bal has released a notification for the recruitment of 872 candidates for the posts of Sub-Inspector, Assistant&nbsp;</p>\r\n', '', '2017-01-18', '2017-01-30', 21753, '2017-01-18 09:22:52', '2017-01-18 09:22:52'),
(18, 'SSC Multitasking Staff (MTS) Notification', 'ssc-multitasking-staff-mts-notification', '', '<p>Staff Selection Commission (SSC) has released a notification for the recruitment of 8300 candidates for the posts of Multi Tasking (Non-Technical) Staff in different States and Union Territories 2016/2017. Interested candidates may check the eligibility criteria and</p>\r\n', '', '2017-01-18', '2018-12-31', 21753, '2017-01-18 09:27:57', '2017-01-18 09:27:57'),
(19, 'PGT/TGT', 'pgttgt', 'harkhand Staff Selection Commission (JSSC) has released a notification ', '<p>harkhand Staff Selection Commission (JSSC) has released a notification for the recruitment of 17,793 Trained Graduate Teacher through Combined Graduate Trained Teacher Competitive Exam 2016 (CGTTCE-2016). Interested candidates may check the eligibility criteria and&nbsp;</p>\r\n', '', '2017-01-18', '2018-08-09', 21753, '2017-01-18 09:28:56', '2017-01-18 09:28:56'),
(20, 'Clerks', 'clerks', 'High Court of Punjab & Haryana has released a notification fo', '<p>High Court of Punjab &amp; Haryana has released a notification for the recruitment of 327 Clerks. Interested candidates may check the eligibility criteria&nbsp;</p>\r\n', '', '2017-01-18', '2018-11-28', 21753, '2017-01-18 09:31:44', '2017-01-18 09:31:44'),
(21, 'Technical Assistants (Geophysics)', 'technical-assistants-geophysics', 'Before applying for the post, an applicant shall register his/her bio-data particulars through', '<p>Before applying for the post, an applicant shall register his/her bio-data particulars through One Time Profile Registration (OTPR) on the Commission&rsquo;s Website viz., www.psc.ap.gov.in. Once applicant registers his/her particulars, a User ID is generated and sent to his/her registered mobile number and email ID.</p>\r\n', '', '2017-01-18', '2019-07-17', 21753, '2017-01-18 09:33:15', '2017-01-18 09:33:15'),
(22, 'Sub Inspector, Assistant Sub Inspector', 'sub-inspector-assistant-sub-inspector', 'Uttar Pradesh Police Recruitment and Promotion Board (UPPRPB) has released ', '<p>Uttar Pradesh Police Recruitment and Promotion Board (UPPRPB) has released a notification for the recruitment of 609 Sub Inspector (Confidential), Assistant Sub Inspector (Clerk) and Assistant Sub Inspector (Accounts) for male candidates.&nbsp;</p>\r\n', '', '2017-01-18', '2019-12-13', 21753, '2017-01-18 09:35:48', '2017-01-18 09:35:48'),
(23, 'Multi Tasking Staff (MTS) ', 'multi-tasking-staff-mts', 'Prasar Bharti has released a notification for the recruitment of 33 Multi-Tasking Staff (MTS', '<p>Prasar Bharti has released a notification for the recruitment of 33 Multi-Tasking Staff (MTS) (Non-Technical) under special recruitment drive for PWD candidates for Doordarshan Kendras. Interested candidates may check the eligibility criteria</p>\r\n', '', '2017-01-18', '2019-04-05', 21753, '2017-01-18 09:36:58', '2017-01-18 09:36:58'),
(24, 'Probationary Officers and Probationary Clerks', 'probationary-officers-and-probationary-clerks', 'The South Indian Bank Ltd., a premier Commercial Bank in India, has released ', '<p>The South Indian Bank Ltd., a premier Commercial Bank in India, has released a notification for the recruitment of 537 Probationary Officers and Probationary Clerks. Interested candidates may check the eligibility criteria</p>\r\n', '', '2017-01-18', '2019-07-17', 21753, '2017-01-18 09:38:15', '2017-01-18 09:38:15'),
(25, 'Chief Manager, Manager & Deputy Manager', 'chief-manager-manager-deputy-manager', 'State Bank of India invites Online applications from Indian citizens for appointmen', '<p>State Bank of India invites Online applications from Indian citizens for appointment in following Positions in Specialist Cadre in State Bank of India. Candidates are requested to apply Online through link given in &ldquo;careers with us&rdquo; section of Bank&rsquo;s website www.statebankofindia.com or www.sbi.co.in</p>\r\n', '', '2017-01-18', '2017-01-18', 21753, '2017-01-18 09:39:23', '2017-01-18 09:39:23'),
