(31, 'Assistant Manager (Territory) ', 'assistant-manager-territory', 'India Post Payments Bank Limited (IPPB) has released a notification for the recruitment of 650', '<p>India Post Payments Bank Limited (IPPB) has released a notification for the recruitment of 650 Assistant Manager (Territory) in JMG Scale I. Interested candidates may check the eligibility criteria</p>\r\n', '', '2017-01-18', '2019-11-28', 21753, '2017-01-18 10:10:12', '2017-01-18 10:10:12'),
(32, 'IBPS RRB (CWE - V) Notification', 'ibps-rrb-cwe-v-notification', 'Institute of Banking Personnel Selection (IBPS) has released a notification', '<p>Institute of Banking Personnel Selection (IBPS) has released a notification for the recruitment of Officers (Scale-I, II &amp; III) and Office Assistants (Multipurpose) in Regional Rural Banks (RRBs).</p>\r\n', '', '2017-01-18', '2019-08-15', 21753, '2017-01-18 10:10:45', '2017-01-18 10:10:45'),
(33, 'Credit Officers and Risk Managers', 'credit-officers-and-risk-managers', 'Central Bank of India (CBI) has released a notification for the recruitment of 61 Credit ', '<p>Central Bank of India (CBI) has released a notification for the recruitment of 61 Credit Officers and Risk Managers. Interested candidates may check the eligibility criteria</p>\r\n', '', '2017-01-18', '2019-12-04', 21753, '2017-01-18 10:11:32', '2017-01-18 10:11:32'),
