(37, 'IBPS CWE PO/MT-VI Notification 2016', 'ibps-cwe-pomt-vi-notification-2016', 'Online applications are invited by Institute of Banking Personnel Selection (IBPS) for', '<p>Online applications are invited by Institute of Banking Personnel Selection (IBPS) for CWE PO/MT-VI Exam 2016 to fill 8822 Probationary Officer/Management Trainee vacancies in 22 Indian Nationalized Banks or financial institutions</p>\r\n', '', '2017-01-18', '2019-07-17', 21753, '2017-01-18 10:14:39', '2017-01-18 10:14:39'),
