(39, 'Multipurpose Assistants', 'multipurpose-assistants', 'Applications are invited from Indian citizens for the post of Assistant Manager (Grade A) in the ', '<p>Applications are invited from Indian citizens for the post of Assistant Manager (Grade &lsquo;A&rsquo;) in the Rajbhasha Service and Assistant Manager (Grade &lsquo;A&rsquo;) in the Protocol &amp; Security Service in National Bank for Agriculture and Rural Development (NABARD). C</p>\r\n', '', '2017-01-18', '2019-11-27', 21753, '2017-01-18 10:23:47', '2017-01-18 10:23:47'),
