(43, 'Technical Field Officer and System Administrator', 'technical-field-officer-and-system-administrator', 'Canara Bank has issued a notification for the recruitment of 74 technical field officer and system administrator (specialist officer', '<p>Canara Bank has issued a notification for the recruitment of 74 technical field officer and system administrator (specialist officer, JMGS I &amp; MMGS-II) vacancies. Candidates who are looking for opportunity in banking sector may check the eligibility criteria</p>\r\n', '', '2017-01-18', '2019-11-27', 21753, '2017-01-18 10:27:56', '2017-01-18 10:27:56'),
