(45, 'Security Officers in Grade B Recruitment', 'security-officers-in-grade-b-recruitment', 'IDBI Bank Ltd., a banking company under the Companies Act, 1956, ', '<p>IDBI Bank Ltd., a banking company under the Companies Act, 1956, having majority share holding by Government of India, is a leading provider of complete range of retail and corporate banking services to its clients</p>\r\n', '', '2017-01-18', '2019-11-20', 21753, '2017-01-18 10:38:17', '2017-01-18 10:38:17'),
(46, 'SIDBI Assistant Manager Recruitment', 'sidbi-assistant-manager-recruitment', 'Small Industries Development Bank of India (SIDBI) released a notification for the recruitment of 100 ', '<p>Small Industries Development Bank of India (SIDBI) released a notification for the recruitment of 100 Assistant Manager (Grade - A General Stream). Candidates who are looking for career opportunity in banking sector may check the eligibility criteria</p>\r\n', '', '2017-01-18', '2019-12-27', 21753, '2017-01-18 10:39:28', '2017-01-18 10:39:28'),
(47, 'Specialist Officers Recruitment', 'specialist-officers-recruitment', 'Syndicate Bank invites has released a notification for the recruitment of 115 Manager', '<p>Syndicate Bank invites has released a notification for the recruitment of 115 Manager, Technical Officer and Asst. General Manager for appointment of Specialist Officers in various verticals.&nbsp;</p>\r\n', '', '2017-01-18', '2019-11-27', 21753, '2017-01-18 10:43:03', '2017-01-18 10:43:03'),
(48, 'Career Opportunities with Bandhan Bank', 'career-opportunities-with-bandhan-bank', 'Candidates interested in pursuing career opportunities with Bandhan are requested to e-mail their Bio-Data /', '<p>Candidates interested in pursuing career opportunities with Bandhan are requested to e-mail their Bio-Data / CV / Resume directly to the Human Resources Department at : recruitment@bandhanmf.com OR send your applications by post / courier to the following address:&nbsp;</p>\r\n', '', '2017-01-18', '2019-11-27', 21753, '2017-01-18 10:44:41', '2017-01-18 10:44:41'),
(49, 'KCCB Clerk & Computer Operators recruitment', 'kccb-clerk-computer-operators-recruitment', 'Online applications are invited by Kangra Central Co-Operative Bank (KCCB) ', '<p>Online applications are invited by Kangra Central Co-Operative Bank (KCCB) for the recruitment of 154 posts of Officer Grade 3, Clerk Grade 4 and Computer Operators. Candidates who are willing to pursue their career</p>\r\n', '', '2017-01-18', '2019-11-27', 21753, '2017-01-18 10:48:23', '2017-01-18 10:48:23'),
(50, 'RBI Grade B Officers Recruitment', 'rbi-grade-b-officers-recruitment', 'The Reserve Bank of India (RBI) invites online applications for the Recruitment of ', '<p>The Reserve Bank of India (RBI) invites online applications for the Recruitment of 134 Officers in Grade &lsquo;B&rsquo; (General) - DR &ndash; Batch Year 2015 from Indian citizens.</p>\r\n', '', '2017-01-18', '2019-11-20', 21753, '2017-01-18 10:49:28', '2017-01-18 10:49:28');
