(774, 7, 163, '', 'd6af87b0a9872c97e9e0125ed805b8bec692d3cd', 'para', '<p>I felt the wall of the tunnel shiver. The master alarm squealed through my earphones. Almost simultaneously, Jack yelled down to me that there was a warning light on. Fleeting but spectacular sights snapped into ans out of view, the snow, the shower of debris, the moon, looming close and big, the dazzling sunshine for once unfiltered by layers of air. The last twelve hours before re-entry were particular bone-chilling. During this period, I had to go up in to command module. Even after the fiery re-entry splashing down in 81o&nbsp;water in south pacific, we could still see our frosty breath inside the command module.</p>\r\n', '', 0, 3, '[{"question":"The word \'Command Module\' used twice in the given passage indicates perhaps that it deals with","total_options":"4","options":[["An alarming journey","A commanding situation","A journey into outer space","A frightful battle."]]},{"question":"Which one of the following reasons would one consider as more as possible for the warning lights to be on?","total_options":"4","options":{"1":["There was a shower of debris","Jack was yelling","A catastrophe was imminent","The moon was looming close and big"]}},{"question":"The statement that the dazzling sunshine was \\"for once unfiltered by layers of air\\" means","total_options":"4","options":{"2":["That the sun was very hot","That there was no strong wind","That the air was unpolluted","None of above"]}}]', 3, '[{"answer":"3"},{"answer":"3"},{"answer":"4"}]', 20, 120, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-08 06:52:17', '2017-02-08 06:52:17'),
(775, 7, 163, '', 'cabba9b2f4dbdc2036abbc8deda47b03ccbf768b', 'para', '<p>But I did not want to shoot the elephant. I watched him beating his bunch of grass against his knees, with the&nbsp;<em>preoccupied grandmotherly</em>&nbsp;air that elephants have. It seemed to me that it would be murder to shoot him. I had never shot an elephant and never wanted to. (Somehow it always seems worse to kill large animal.) Besides, there was the beast&#39;s owner to be considered. But I had got to act quickly. I turned to some experienced-looking Burmans who had been there when we arrived, and asked them how the elephants had been behaving. They all said the same thing; he took no notice of you if you left him alone, but he might charge if you went too close to him.</p>\r\n', '', 0, 3, '[{"question":"The phrase \'Preoccupied grandmotherly air\' signifies","total_options":"4","options":[["Being totally unconcerned","Pretending to be very busy","A very superior attitude","Calm, dignified and affectionate disposition"]]},{"question":"From the passage it appears that the author was","total_options":"4","options":{"1":["An inexperienced hunter","Kind and considerate","Possessed with fear","A worried man"]}},{"question":"The author did not want to shoot the elephant because he","total_options":"4","options":{"2":["Was afraid of it","Did not have the experience of shooting big animals","Did not wish to kill animal which was not doing anybody any harm","Did not find the elephant to be ferocious"]}}]', 3, '[{"answer":"4"},{"answer":"2"},{"answer":"2"}]', 20, 120, 'hard', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-08 06:59:14', '2017-02-08 06:59:14'),
(776, 15, 187, '', '4fd6fb41fe19bd61bdffdabf23ea4144e7b266fa', 'video', '<p>Harold a professional man who had worked in an office for many years had a fearful dream. In it, he found himself in a land where small slug-like animals with slimy tentacles lived on people&#39;s bodies. The people tolerated the loathsome creatures because after many years they grew into elephants which then became the nation&#39;s system of transport, carrying everyone wherever he wanted to go. Harold suddenly realised that he himself was covered with these things, and he woke up screaming. In a vivid sequence of pictures this dream dramatised for Harold what he had never been able to put in to words; he saw himself as letting society feed on his body in his early years so that it would carry him when he retired. He later threw off the &quot;security bug&quot; and took up freelance work.</p>\r\n', '776question.mp4', 0, 4, '[{"question":"In his dream Harold found the loathsome creatures","total_options":"4","options":[["In his village","In his own house","In a different land","In his office"]]},{"question":"Which one of the following phrases best helps to bring out the precise meaning of \'loathsome creatures\'?","total_options":"4","options":{"1":["Security bug and slimy tentacles","Fearful dream and slug-like animals","Slimy tentacles and slug-like animals","Slug-like animals and security bug"]}},{"question":"The statement that \'he later threw off the security bug\' means that","total_options":"4","options":{"2":["Harold succeeded in overcoming the need for security","Harold stopped giving much importance to dreams","Harold started tolerating social victimisation","Harold killed all the bugs troubled him"]}},{"question":"Harold\'s dream was fearful because","total_options":"4","options":{"3":["It brought him face to face with reality","It was full of vivid pictures of snakes","He saw huge elephant in it","In it he saw slimy creatures feeding on people\'s bodies"]}}]', 4, '[{"answer":"3"},{"answer":"3"},{"answer":"1"},{"answer":"1"}]', 20, 150, 'hard', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-08 07:08:15', '2017-02-08 07:08:15'),
(777, 1, 147, '', '524e00d06a9b69117edad61710e42ba22b57c7ce', 'radio', '<p>What number comes inside the circle?</p>\r\n', '777question.png', 0, 4, '[{"option_value":"4","has_file":0,"file_name":""},{"option_value":"5","has_file":0,"file_name":""},{"option_value":"6","has_file":0,"file_name":""},{"option_value":"8","has_file":0,"file_name":""}]', 1, '3', 4, 100, 'hard', 'No Hint', '<p>Looking at the diagram in rows, the central circle equals half the sum of the numbers in the other circles to the left and right of the centre.</p>\r\n', NULL, 1, '2017-02-08 07:13:03', '2017-02-08 07:13:03'),
(778, 1, 146, '', '9e86beb59c401089957c28c8b66fb9972f7adbd9', 'radio', '<p>Which number replaces the question mark?</p>\r\n', '778question.png', 0, 4, '[{"option_value":"1","has_file":0,"file_name":""},{"option_value":"4","has_file":0,"file_name":""},{"option_value":"6","has_file":0,"file_name":""},{"option_value":"9","has_file":0,"file_name":""}]', 1, '4', 4, 120, 'hard', 'No Hint', '<p>The number at the centre of each triangle equals the sum of the lower two numbers minus the top number.</p>\r\n', NULL, 1, '2017-02-08 07:19:18', '2017-02-08 07:19:18'),
(779, 15, 188, '', 'bed21175bdc2d0a99abf9dea7cba5b7d9bc37796', 'match', '<p>Match the following objects ?</p>\r\n', '', 0, 4, '{"left":{"title":"Cup","options":["THOMAS CUP","SWAYTHLING CUP","DAVIS CUP","RYDER CUP"]},"right":{"title":"Sport Type","options":["LAWN TENNIS","TABLE TENNIS","BADMINTON","GOLF"]}}', 4, '[{"answer":"3"},{"answer":"2"},{"answer":"1"},{"answer":"4"}]', 20, 130, 'easy', 'No Hint', '<p>Cups and Sports Data</p>\r\n', NULL, 1, '2017-02-08 09:14:59', '2017-02-08 09:14:59'),
(780, 15, 189, '', '777a4130fd7af1953afb54af0bfa84ccee1b7baf', 'match', '<p>Match the following Names ?</p>\r\n', '', 0, 4, '{"left":{"title":"Person","options":["BROTHER","NEPHEW","FATHER","UNCLE"]},"right":{"title":"Person","options":["MOTHER","AUNT","SISTER","NIECE"]}}', 4, '[{"answer":"3"},{"answer":"4"},{"answer":"1"},{"answer":"2"}]', 20, 140, 'hard', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-08 09:17:28', '2017-02-08 09:17:28'),
(783, 15, 187, '', '917833cc2d8fa643b0f68196ed992acebd5e2fb1', 'video', '<p>Whatch the following video and Answer the given questions</p>\r\n', '783question.mp4', 0, 4, '[{"question":"If a piece of matter violates nature\'s law, it is not punished because","total_options":"4","options":[["It is not binding to obey it","There is no superior being to enforce the law of nature","It cannot be punished","It simply means that the facts have not been correctly stated by law"]]},{"question":"Laws of nature differ from man-made laws because","total_options":"4","options":{"1":["The former state facts of Nature","They must be obeyed","They are natural","Unlike human laws, they are systematic"]}},{"question":"The laws of nature based on observation are","total_options":"4","options":{"2":["Conclusion about the nature of the universe.","True and unfalsifiable.","Figments of the observer imagination.","Subject to change in the light of new facts."]}},{"question":"The author is not happy with word \'law\' because","total_options":"4","options":{"3":["It connotes rigidity and harshness","It implies an agency which has made them","It does not convey the sense of nature\'s uniformity","It gives rise to false beliefs"]}}]', 4, '[{"answer":"2"},{"answer":"1"},{"answer":"4"},{"answer":"1"}]', 10, 150, 'hard', 'No Hint', '<p>No Hint</p>\r\n', NULL, 1, '2017-02-08 13:24:32', '2017-02-08 13:24:32'),
